const jokesData = [
  {
    id: 1,
    punchline: "Sometimes, just punchline is enough",
  },
  {
    id: 2,
    question: "which movies does pandas like?",
    punchline: "Old ones, because they are black and white",
  },
  {
    id: 3,
    question: "why is 6 scared of 7?",
    punchline: "Because 7 8 9",
  },
];

export default jokesData;
